DROP TABLE IF EXISTS `rule_order_monitor`;

CREATE TABLE `rule_order_monitor` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '指标的编号',
  `field` varchar(50) DEFAULT NULL COMMENT '指标的字段表示',
  `desc` varchar(250) DEFAULT NULL COMMENT '指标的描述',
  `groupId` varchar(25) DEFAULT NULL COMMENT '指标的分类',
  `createUser` varchar(50) DEFAULT NULL COMMENT '创建用户',
  `updateUser` varchar(50) DEFAULT NULL COMMENT '修改用户',
  `createDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `updateDate` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

